    public boolean hasGroupsSizeX(int[] deck) {
        if (deck == null) {
            return false;
        }
        if (deck.length == 0) {
            return false;
        }

        Map<Integer, Integer> map = new HashMap<>();

        for (int i : deck) {
            map.put(i, map.getOrDefault(i, 0) + 1);
        }

        int min = Integer.MAX_VALUE;
        int max = Integer.MIN_VALUE;
        for (Integer value : map.values()) {
            if (value == 1) {
                return false;
            }
            if (min > value) {
                min = value;
            }
            if (max < value) {
                max = value;
            }
        }
        if (min == max) {
            return true;
        }
        int minG = -1;
        for (int i = 2; i < min+1 / 2+1; i++) {
            if (min % i == 0 && max % i == 0) {
                minG = i;
                if (a(map,minG)){
                    return true;
                }
            }
        }
        if (minG == -1) {
            if (max % min == 0) {
                minG = min;
            } else {
                return false;
            }
        }

        for (Integer value : map.values()) {
            if (value % minG != 0) {
                return false;
            }
        }


        return true;
    }

    private boolean a(Map<Integer,Integer> map,int minG){
        for (Integer value : map.values()) {
            if (value % minG != 0) {
                return false;
            }
        }
        return true;
    }

